import React, { Component } from 'react'

//components

class privacyPolicy extends Component {
    render() {
        return (
            <div className="privacyPolicy">
                <h1 style={{textAlign:"center"}}>Privacy Policy</h1>
                <p><b>Complaints:</b> If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.</p>
            </div>
        )
    }
}

export default privacyPolicy
